import React from 'react';
import styled from 'styled-components';

const ResultsContainer = styled.div`
  background: white;
  border-radius: 20px;
  padding: 2rem;
  box-shadow: 0 10px 30px rgba(0,0,0,0.2);
  max-width: 1200px;
  margin: 0 auto;
`;

const ResultsHeader = styled.div`
  text-align: center;
  margin-bottom: 2rem;
`;

const ResultsTitle = styled.h2`
  font-size: 2rem;
  color: #333;
  margin-bottom: 1rem;
`;

const ResultsSubtitle = styled.p`
  font-size: 1.1rem;
  color: #666;
  margin-bottom: 2rem;
`;

const UserProfileSection = styled.div`
  background: #f8f9ff;
  border-radius: 12px;
  padding: 1.5rem;
  margin-bottom: 2rem;
  border-left: 4px solid #667eea;
`;

const UserProfileTitle = styled.h3`
  font-size: 1.3rem;
  color: #333;
  margin-bottom: 1rem;
`;

const UserLabelsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
  gap: 1rem;
`;

const LabelItem = styled.div`
  background: white;
  padding: 0.8rem;
  border-radius: 8px;
  border: 1px solid #e0e0e0;
`;

const LabelName = styled.div`
  font-size: 0.9rem;
  color: #666;
  margin-bottom: 0.3rem;
`;

const LabelValue = styled.div`
  font-size: 1rem;
  color: #333;
  font-weight: 500;
`;

const RecommendationsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(350px, 1fr));
  gap: 2rem;
  margin-bottom: 2rem;
`;

const RacketCard = styled.div`
  background: white;
  border: 2px solid #e0e0e0;
  border-radius: 16px;
  padding: 1.5rem;
  transition: all 0.3s ease;
  position: relative;
  overflow: hidden;

  &:hover {
    border-color: #667eea;
    transform: translateY(-5px);
    box-shadow: 0 10px 25px rgba(102, 126, 234, 0.2);
  }

  &:nth-child(1) {
    border-color: #ffd700;
    background: linear-gradient(135deg, #fff9e6 0%, #fff 100%);
  }

  &:nth-child(2) {
    border-color: #c0c0c0;
    background: linear-gradient(135deg, #f8f9fa 0%, #fff 100%);
  }

  &:nth-child(3) {
    border-color: #cd7f32;
    background: linear-gradient(135deg, #fdf6e3 0%, #fff 100%);
  }
`;

const RankBadge = styled.div`
  position: absolute;
  top: 1rem;
  right: 1rem;
  width: 40px;
  height: 40px;
  border-radius: 50%;
  display: flex;
  align-items: center;
  justify-content: center;
  font-weight: bold;
  font-size: 1.2rem;
  color: white;
  
  ${props => {
    switch(props.rank) {
      case 1: return 'background: linear-gradient(135deg, #ffd700, #ffed4e);';
      case 2: return 'background: linear-gradient(135deg, #c0c0c0, #e0e0e0);';
      case 3: return 'background: linear-gradient(135deg, #cd7f32, #daa520);';
      default: return 'background: #667eea;';
    }
  }}
`;

const RacketName = styled.h3`
  font-size: 1.4rem;
  color: #333;
  margin-bottom: 1rem;
  padding-right: 50px;
`;

const SimilarityScore = styled.div`
  display: flex;
  align-items: center;
  margin-bottom: 1rem;
`;

const ScoreBar = styled.div`
  flex: 1;
  height: 8px;
  background: #e0e0e0;
  border-radius: 4px;
  margin-right: 1rem;
  overflow: hidden;
`;

const ScoreFill = styled.div`
  height: 100%;
  background: linear-gradient(90deg, #667eea, #764ba2);
  width: ${props => props.score}%;
  transition: width 0.5s ease;
`;

const ScoreText = styled.span`
  font-weight: bold;
  color: #667eea;
  min-width: 50px;
`;

const RacketDetails = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr;
  gap: 1rem;
  margin-bottom: 1rem;
`;

const DetailItem = styled.div`
  display: flex;
  flex-direction: column;
`;

const DetailLabel = styled.span`
  font-size: 0.8rem;
  color: #666;
  margin-bottom: 0.2rem;
`;

const DetailValue = styled.span`
  font-size: 0.9rem;
  color: #333;
  font-weight: 500;
`;

const Price = styled.div`
  font-size: 1.2rem;
  font-weight: bold;
  color: #667eea;
  margin-bottom: 1rem;
`;

const Features = styled.div`
  background: #f8f9ff;
  padding: 1rem;
  border-radius: 8px;
  margin-bottom: 1rem;
`;

const FeaturesTitle = styled.div`
  font-size: 0.9rem;
  font-weight: 500;
  color: #333;
  margin-bottom: 0.5rem;
`;

const FeaturesText = styled.div`
  font-size: 0.8rem;
  color: #666;
  line-height: 1.4;
`;

const ActionButtons = styled.div`
  display: flex;
  gap: 1rem;
  justify-content: center;
  margin-top: 2rem;
`;

const Button = styled.button`
  padding: 1rem 2rem;
  border: none;
  border-radius: 8px;
  font-size: 1rem;
  cursor: pointer;
  transition: all 0.3s ease;
  font-weight: 500;
`;

const RestartButton = styled(Button)`
  background: #f0f0f0;
  color: #666;
  
  &:hover {
    background: #e0e0e0;
    transform: translateY(-2px);
  }
`;

const CompareButton = styled(Button)`
  background: linear-gradient(135deg, #667eea, #764ba2);
  color: white;
  
  &:hover {
    transform: translateY(-2px);
    box-shadow: 0 5px 15px rgba(102, 126, 234, 0.4);
  }
`;

function Results({ recommendations, userLabels, onRestart }) {
  const getLabelDisplayName = (key) => {
    const labelNames = {
      PlayStyle: 'ÌîåÎ†àÏù¥ Ïä§ÌÉÄÏùº',
      WeightPref: 'Î¨¥Í≤å ÏÑ†Ìò∏ÎèÑ',
      BalancePref: 'Î∞∏Îü∞Ïä§ ÏÑ†Ìò∏ÎèÑ',
      ShaftFlex: 'ÏÉ§ÌîÑÌä∏ Ïú†Ïó∞ÏÑ±',
      GripStrength: 'Í∑∏Î¶Ω Í∞ïÎèÑ',
      Level: 'Ïã§Î†• Î†àÎ≤®'
    };
    return labelNames[key] || key;
  };

  const formatPrice = (priceStr) => {
    if (!priceStr) return 'Í∞ÄÍ≤© Ï†ïÎ≥¥ ÏóÜÏùå';
    return priceStr.trim();
  };

  const formatFeatures = (features) => {
    if (!features) return 'ÌäπÏßï Ï†ïÎ≥¥ ÏóÜÏùå';
    return features.length > 100 ? features.substring(0, 100) + '...' : features;
  };

  return (
    <ResultsContainer>
      <ResultsHeader>
        <ResultsTitle>üéØ ÎãπÏã†ÏóêÍ≤å Ï∂îÏ≤úÌïòÎäî ÎùºÏºì</ResultsTitle>
        <ResultsSubtitle>
          ÏÑ§Î¨∏ Í≤∞Í≥ºÎ•º Î∞îÌÉïÏúºÎ°ú ÏµúÏ†ÅÏùò ÎùºÏºìÏùÑ Ï∞æÏïòÏäµÎãàÎã§
        </ResultsSubtitle>
      </ResultsHeader>

      <UserProfileSection>
        <UserProfileTitle>üìä ÎãπÏã†Ïùò Î∞∞ÎìúÎØºÌÑ¥ ÌîÑÎ°úÌïÑ</UserProfileTitle>
        <UserLabelsGrid>
          {Object.entries(userLabels).map(([key, value]) => (
            value && (
              <LabelItem key={key}>
                <LabelName>{getLabelDisplayName(key)}</LabelName>
                <LabelValue>{value}</LabelValue>
              </LabelItem>
            )
          ))}
        </UserLabelsGrid>
      </UserProfileSection>

      <RecommendationsGrid>
        {recommendations.map((racket, index) => (
          <RacketCard key={index}>
            <RankBadge rank={index + 1}>{index + 1}</RankBadge>
            
            <RacketName>{racket['Ï¢ÖÎ•ò']}</RacketName>
            
            <SimilarityScore>
              <ScoreBar>
                <ScoreFill score={racket.similarityScore} />
              </ScoreBar>
              <ScoreText>{Math.round(racket.similarityScore)}%</ScoreText>
            </SimilarityScore>
            
            <Price>{formatPrice(racket[' Í∞ÄÍ≤© '])}</Price>
            
            <RacketDetails>
              <DetailItem>
                <DetailLabel>Î¨¥Í≤å</DetailLabel>
                <DetailValue>{racket['Î¨¥Í≤å'] || 'Ï†ïÎ≥¥ ÏóÜÏùå'}</DetailValue>
              </DetailItem>
              <DetailItem>
                <DetailLabel>Î∞∏Îü∞Ïä§</DetailLabel>
                <DetailValue>{racket['Î∞∏Îü∞Ïä§ Ìè¨Ïù∏Ìä∏'] || 'Ï†ïÎ≥¥ ÏóÜÏùå'}</DetailValue>
              </DetailItem>
              <DetailItem>
                <DetailLabel>ÏÉ§ÌîÑÌä∏</DetailLabel>
                <DetailValue>{racket['ÏÉ§ÌîÑÌä∏ Ïú†Ïó∞ÏÑ±'] || 'Ï†ïÎ≥¥ ÏóÜÏùå'}</DetailValue>
              </DetailItem>
              <DetailItem>
                <DetailLabel>Ï∂úÏãúÏùº</DetailLabel>
                <DetailValue>{racket['Ï∂úÏãúÎÇ†Ïßú'] || 'Ï†ïÎ≥¥ ÏóÜÏùå'}</DetailValue>
              </DetailItem>
            </RacketDetails>
            
            <Features>
              <FeaturesTitle>Ï£ºÏöî ÌäπÏßï</FeaturesTitle>
              <FeaturesText>{formatFeatures(racket['Ï†ÅÏö© ÏÜåÏû¨ Î∞è Í∏∞Ïà†Î†•'])}</FeaturesText>
            </Features>
          </RacketCard>
        ))}
      </RecommendationsGrid>

      <ActionButtons>
        <RestartButton onClick={onRestart}>
          üîÑ Îã§Ïãú Ï∂îÏ≤úÎ∞õÍ∏∞
        </RestartButton>
        <CompareButton onClick={() => alert('ÎπÑÍµê Í∏∞Îä•ÏùÄ Ï∂îÌõÑ ÏóÖÎç∞Ïù¥Ìä∏ ÏòàÏ†ïÏûÖÎãàÎã§!')}>
          ‚öñÔ∏è ÎùºÏºì ÎπÑÍµêÌïòÍ∏∞
        </CompareButton>
      </ActionButtons>
    </ResultsContainer>
  );
}

export default Results;
